var filegroup_tbl=$("#filegroup_tbl").DataTable({pageLength:10,responsive:true,aoColumns:[{mData:"name"},{mData:"creationTime"}],columnDefs:[{width:"0",className:"text-center",targets:1},{orderable:false,bSearchable:false,width:"0",className:"text-center",targets:2},{orderable:false,bSearchable:false,width:"0",className:"text-center",targets:3}],order:[[1,"desc"]]});$("#filegroup_tbl tbody").on("click","tr td .delete",function(){var d=$(this).parents("tr")[0];var c=filegroup_tbl.row(d);var a=c.node();var b=c.data();$("#delete_file_name").text(b.name);$("#del_btn").data("id",c.index());$("#del_btn").data("href",$(a).find(".delete").data("href"));$("#confirm_delete").modal("toggle")});$(document).on("click","#del_btn",function(b){var a=$("#del_btn").data("href");$.ajax({url:encodeURI(a),type:"DELETE",success:function(){var d=$("#del_btn").data("id");var c=filegroup_tbl.row(d);c.remove().draw()}})});$("body").tooltip({selector:'[data-toggle="tooltip"]'});